  {
    path:'/home',
    display:'Home'
    
  },
  {
    path:'#',
    display:'About'
  },
  {
    path:'/tours',
    display:'Tours'
  }
]

const Header = () => {
  return <header className="header">
    <Container>
      <Row>
        <div className="nav_wrapper d-flex align-items-center
        justify-content-between">

          {/*=========== logo ============== */}
          <div className="logo"></div>
          <img src="" alt=""/>
          {/*=========== logo end ============== */}

        </div>
      </Row>
    </Container>
  </header>
}

export default Header
